import React from 'react';

class Tabla extends React.Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Edad</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Juan</td>
            <td>30</td>
          </tr>
          <tr>
            <td>Mar√≠a</td>
            <td>25</td>
          </tr>
          <tr>
            <td>Carlos</td>
            <td>35</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Tabla;
